### Summary

The markers are not visible only when the map is loaded for the first time after launching the app.
However, if I navigate to another screen and then return, the markers appear normally.
I updated to version 1.25.3, and this caused the issue.


### Reproducible sample code

```TSX
interface CustomMarkerProps {
  location: Location;
  nickname: string;
  profileUrl?: string;
  id: string;
}

export default function CustomMarker({
  location,
  nickname,
  profileUrl,
  id,
}: CustomMarkerProps) {
  const ProfileImage = () => {
    if (!profileUrl) return;
    return (
      <View>
        <Image
          source={{ uri: profileUrl }}
          style={{
            overflow: "hidden",
            width: 50,
            height: 50,
            borderRadius: 25,
          }}
        />
      </View>
    );
  };

  const CallOut = () => {
    if (!nickname) return;
    return (
      <Callout tooltip={true}>
        <View className="p-[10px] bg-[#181A20CC] rounded-[8px]">
          <Text
            className="text-white w-full"
            numberOfLines={1}
            ellipsizeMode="tail"
          >
            {nickname}
          </Text>
        </View>
      </Callout>
    );
  };

  return (
    <Marker
      id={id}
      coordinate={{
        latitude: location.latitude,
        longitude: location.longitude,
      }}
    >
      {ProfileImage()}
      {CallOut()}
    </Marker>
  );
}


const myLocationMarker = useMemo(() => {
    if (!location || !user) {
      return;
    }
    return (
      <CustomMarker
        id={user.id}
        profileUrl={user.profile_image}
        nickname={user.nickname}
        location={location}
      />
    );
  }, [location, user]);


<MapView
        ref={mapRef}
        region={{
          latitude: location?.latitude,
          longitude: location?.longitude,
          latitudeDelta: 0.05,
          longitudeDelta: 0.05,
        }}
        provider={PROVIDER_GOOGLE}
        style={{ width: "100%", height: "100%" }}
        showsBuildings={false}
        scrollDuringRotateOrZoomEnabled={false}
        rotateEnabled={false}
        zoomTapEnabled={false}
        toolbarEnabled={false}
      >
        {myLocationMarker}
        {groupMembers
          .filter(
            (member) => member.user_id !== user?.id && member && member.location
          ) // ìœ„ì¹˜ ì •ë³´ê°€ ìžˆëŠ” ë©¤ë²„ë§Œ
          .map((member) => {
            return (
              <CustomMarker
                id={member.user_id}
                profileUrl={member.profile_image}
                nickname={member.nickname}
                location={member.location!!}
              />
            );
          })}
        {selectedGroup && (
          <CustomMarker
            id={selectedGroup.id}
            profileUrl={selectedGroup.group_image_url}
            nickname={`${selectedGroup.display_name}`}
            location={{
              latitude: selectedGroup.latitude,
              longitude: selectedGroup.longitude,
            }}
          />
        )}
      </MapView>
```

### Steps to reproduce

1. Observe that markers are not visible when the map first loads.

2. Navigate to another screen.

3. Return to the map screen and observe that markers are now visible.

### Expected result

The markers should also be visible when the map loads for the first time.

### Actual result

The markers are not visible.

### React Native Maps Version

1.25.3

### What platforms are you seeing the problem on?

Android

### React Native Version

0.79.5

### What version of Expo are you using?

SDK 53

### Device(s)

android emulator

### Additional information

_No response_

